INFO:

It's gonna be a long, hard night... Returning home from a nightmarish blind date, Felicia (Stormy Daniels) walks in on her kinky free-spirited roommate, Alice (Asa Akira) as she's engaged in her own &quot;date&quot;. Felicia lets them have their fun and goes to a local dive bar for a much needed cocktail. She meets a charming, sexy bartender and although he's younger and not her type, sparks - and clothes - fly. This innocent one-night stand, however, turns into a crazy evening of guns, drugs, kidnapping and a surprise love connection.


